import './RecipesItems.css'
import React from "react"

const RecipesItems =  (props) => {

    return (
        <div>
            <h2>Listado de recetas</h2>
            {props.recipesList.map((recipe) => 
                <div>
                <img src={recipe.imageUrl}/>
                <p>{recipe.name}</p>
                </div>
    
            )}
        </div>
    )
}
export default RecipesItems
